import{_ as a,c as t,o as i,a2 as o}from"./chunks/framework.BfF5VrUX.js";const b=JSON.parse('{"title":"特定问题排查步骤","description":"","frontmatter":{},"headers":[],"relativePath":"zh/start/problem_specific_check.md","filePath":"zh/start/problem_specific_check.md"}'),r={name:"zh/start/problem_specific_check.md"};function e(s,l,p,c,g,h){return i(),t("div",null,[...l[0]||(l[0]=[o('<h1 id="特定问题排查步骤" tabindex="-1">特定问题排查步骤 <a class="header-anchor" href="#特定问题排查步骤" aria-label="Permalink to &quot;特定问题排查步骤&quot;">​</a></h1><h2 id="_1-指纹浏览器无法启动" tabindex="-1">1. 指纹浏览器无法启动 <a class="header-anchor" href="#_1-指纹浏览器无法启动" aria-label="Permalink to &quot;1. 指纹浏览器无法启动&quot;">​</a></h2><p>一般常见于您同一个账号登录了多台电脑，比如A，B两台，A电脑上您创建了一个指纹环境P1，接着您再B电脑上登录了账号，尝试启动指纹环境P1，此时如果A电脑没有启动客户端，B电脑上启动指纹环境P1会报错。</p><p>要解决这个问题有下面两种方法</p><ul><li>A电脑开机，并启动客户端</li><li>在B电脑上打开客户端，将指纹环境P1批量迁移到本地</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/qy01.png" alt="迁移指纹环境" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/qy02.png" alt="迁移指纹环境" loading="lazy"></p><p>为了避免这种问题，请尽可能在同一台电脑上使用</p><h2 id="_2-指纹浏览器任务长时间不执行" tabindex="-1">2. 指纹浏览器任务长时间不执行 <a class="header-anchor" href="#_2-指纹浏览器任务长时间不执行" aria-label="Permalink to &quot;2. 指纹浏览器任务长时间不执行&quot;">​</a></h2><blockquote><p>当前创建任务后，任务开关会自动开启，如果发现还是长时间不会执行，请按照如下步骤检查</p></blockquote><ul><li>找到对应的指纹设备，在控制界面的顶部导航点击<strong>任务[RPA]</strong>，看一下是不是没有到执行时间。</li><li>尝试一下手动启动指纹浏览器，看能否正常启动，无法正常启动，请参考<a href="./problem_specific_check.html#_1-指纹浏览器无法启动">指纹浏览器无法启动</a>，<strong>注意手动启动后，请打开任务执行开关，后续的自动化任务才会执行</strong></li><li>找到对应的指纹设备，在控制界面的顶部导航点击<strong>任务[RPA]</strong>，是否有其它排在之前的任务还没执行完(可以停止之前的任务)。</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/noexec01.png" alt="任务长时间不执行" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/noexec02.png" alt="任务长时间不执行" loading="lazy"></p><h2 id="_3-手机上任务长时间不执行" tabindex="-1">3. 手机上任务长时间不执行 <a class="header-anchor" href="#_3-手机上任务长时间不执行" aria-label="Permalink to &quot;3. 手机上任务长时间不执行&quot;">​</a></h2><ul><li>查看一下手机上的XROBOT APP是否正常启动，并且登录链接正常（如果您修改了您账号的密码，XROBOT需要重新登录，不然无法正常链接），链接不正常可尝试重新登录，或者检查一下可绑定的设备数是不是满了</li><li>如果您中途更换电脑，尝试重新绑定设备管理器</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/resetPhoneManager01.png" alt="重置手机的设备管理器" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/resetPhoneManager02.png" alt="重置手机的设备管理器" loading="lazy"></p><ul><li>如果您使用的是盒子模拟的手机，因为同一个机位下只能一个手机启动执行任务，请检查一下是否是同机位下其它手机有任务还没执行完，如执行完会自动轮流其它的手机执行任务。</li><li>类似指纹浏览器，可能该手机还有其他任务没有执行完或者是创建的任务还没到执行时间，和指纹浏览器一样，打开该设备的任务列表，确认此情况。</li></ul><h2 id="_4-带附件的发帖-发私信任务执行失败" tabindex="-1">4. 带附件的发帖/发私信任务执行失败 <a class="header-anchor" href="#_4-带附件的发帖-发私信任务执行失败" aria-label="Permalink to &quot;4. 带附件的发帖/发私信任务执行失败&quot;">​</a></h2><ul><li>确保上传的文件没有同步云端，因为如果同步云端可能需要从云端下载，如果您网络比较慢或者文件比较大，容易超时失败，如果之前不小心同步云端，请删除之前的附件，重新上传，重新创建任务。 <img src="https://spub.xrobot.tech/blog/src/img/up01.png" alt="文件上传" loading="lazy"></li><li>如果您是在手机上执行任务，请确保手机与您当前电脑内网互通，如果不知道如何判断是否互通，请直接尝试点击下图所展示区域，轮流切换内网IP，切换后，重启失败任务试试看。 <img src="https://spub.xrobot.tech/blog/src/img/aip01.png" alt="切换内网IP" loading="lazy"></li></ul><h2 id="_5-客户端连接不上盒子" tabindex="-1">5. 客户端连接不上盒子 <a class="header-anchor" href="#_5-客户端连接不上盒子" aria-label="Permalink to &quot;5. 客户端连接不上盒子&quot;">​</a></h2><ul><li>盒子必须和客户端所在电脑位于同一个局域网</li><li>客户端绑定的盒子IP需要和盒子IP一致，并且盒子需要处于开机状态</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/boxip01.png" alt="盒子IP" loading="lazy"></p><ul><li>魔云腾必须安装超级SDK插件</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/sdk01.png" alt="盒子IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/sdk02.png" alt="盒子IP" loading="lazy"></p><h2 id="_6-盒子模拟的手机无法正常显示界面" tabindex="-1">6. 盒子模拟的手机无法正常显示界面 <a class="header-anchor" href="#_6-盒子模拟的手机无法正常显示界面" aria-label="Permalink to &quot;6. 盒子模拟的手机无法正常显示界面&quot;">​</a></h2><ul><li>检查一下盒子是否开机并连接内网，如果均正常，请尝试断电重启盒子5分钟后查看。</li><li>依然异常，请打开魔云腾官方客户端，看一下机位是否到期了，如果到期请续期一下，5分钟后再观察。</li><li>依然异常，请检查一下系统绑定的手机的ip和魔云腾显示的ip是否一致，如果不一致请尝试批量修改绑定的IP，和魔云腾显示的ip一致。</li></ul><p><img src="https://spub.xrobot.tech/blog/src/img/rip01.png" alt="切换内网IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/rip02.png" alt="切换内网IP" loading="lazy"></p><p><img src="https://spub.xrobot.tech/blog/src/img/rip03.png" alt="切换内网IP" loading="lazy"></p>',31)])])}const u=a(r,[["render",e]]);export{b as __pageData,u as default};
